description:
Het is bijna Kerstmis, maar voor de 12-jarige Emma O Conner lijkt dat geen leuke tijd te worden. Ze heeft geen moeder meer en haar vader is werkloos, waardoor zij uit huis worden gezet. Douglas O Conner ziet geen andere mogelijkheid dan zijn dochter naar tante Delores te sturen. Als Emma daar aankomt, blijkt zij helemaal niet welkom te zijn. Net als de honden in de stad trouwens. Burgemeester Nobel Doyle wil namelijk een wet tegen honden invoeren. Cathy Stevens, een dame die honden uit het hele land opvangt en verzorgt, is het daar natuurlijk niet mee eens. Samen met vrienden en honden organiseert Emma een kerstuitvoering. Zo probeert zij de honden enn zichzelf te redden.

